import{_ as i,a as r,H as t,S as o,D as s,o as n}from"./chunks/framework.DX1C7ho2.js";const g=JSON.parse('{"title":"Monthly Updates [Feb]","description":"Febuary 2024 updates.","frontmatter":{"title":"Monthly Updates [Feb]","description":"Febuary 2024 updates.","date":"2024-02-01T00:00:00.000Z","next":false,"aside":"right","prev":false,"footer":true},"headers":[],"relativePath":"posts/feb-2024.md","filePath":"posts/feb-2024.md"}'),d={name:"posts/feb-2024.md"};function l(p,e,h,f,u,c){const a=s("Post");return n(),r("div",null,[t(a,{authors:"nbats"}),e[0]||(e[0]=o('<div class="info custom-block"><p class="custom-block-title">INFO</p><p>These update threads only contains major updates. If you&#39;re interested in seeing all minor changes you can follow our <a href="https://github.com/Lost Pages/Lost Pagesedit/commits/main" target="_blank" rel="noreferrer">Commits Page</a> on GitHub or <a href="https://redd.it/17f8msf" target="_blank" rel="noreferrer">Updates Channel</a> in Discord.</p></div><h3 id="wiki-updates" tabindex="-1">Wiki Updates <a class="header-anchor" href="#wiki-updates" aria-label="Permalink to &quot;Wiki Updates&quot;">​</a></h3><ul><li><p>Our official pastebin, <strong><a href="https://pastes.Lost Pages.net/" target="_blank" rel="noreferrer">snowbin</a></strong> is now live! Keep in mind pastes only last for 7 days, and as of now you can&#39;t make edits, but we may add features like this in the future.</p></li><li><p>Ran a <a href="https://i.imgur.com/73paJlr.png" target="_blank" rel="noreferrer">poll</a> regarding streaming sites, and used the results to help us re-order the <a href="/videopiracyguide">streaming section.</a></p></li><li><p>Turned Spotify into its own section w/ subsections: <a href="/audiopiracyguide#spotify-clients">Clients</a>, <a href="/audiopiracyguide#spotify-adblockers">Adblockers</a>, <a href="/audiopiracyguide#spotify-download">Download</a> and <a href="/audiopiracyguide#spotify-tools">Tools</a>.</p></li><li><p>Added a section for <a href="/audiopiracyguide#media-soundtracks">Soundtracks</a> in Audio.</p></li><li><p>Added sections for <a href="/devtools#computer-science">Computer Science</a> and <a href="/devtools#docker-tools">Docker</a> in Dev Tools.</p></li><li><p>Added a section for <a href="/adblockvpnguide#two-factor-authentication">Two-Factor Authentication</a> in Web Privacy.</p></li><li><p>Re-organized <a href="/readingpiracyguide#magazines">Magazine Sites</a> + added filehosts to their descriptions.</p></li><li><p>Removed OnStream from unsafe sites. The <a href="https://rentry.co/upo2r" target="_blank" rel="noreferrer">&quot;evidence&quot;</a> we had listed wasn&#39;t very solid. If someone has more proof we can re-consider, but for now we don&#39;t have reason enough to call them unsafe. Keep in mind its not posted in the wiki, just removed from our unsafe list.</p></li><li><p>We recently moved off Netlify, and soon after a scammer <a href="https://i.imgur.com/rByoHnf.png" target="_blank" rel="noreferrer">took over the domain</a>. If you had this page bookmarked we&#39;d highly recommend you remove it, and update to our <a href="/">new domain</a>. We&#39;ve tried reporting it to Netlify, but so far they haven&#39;t done anything.</p></li><li><p>Grammar issues have been fixed <a href="https://github.com/Lost Pages/Lost Pagesedit/pull/1337" target="_blank" rel="noreferrer">throughout the wiki</a> / <a href="https://github.com/Lost Pages/Lost Pagesedit/pull/1340" target="_blank" rel="noreferrer">2</a> / <a href="https://github.com/Lost Pages/Lost Pagesedit/pull/1339" target="_blank" rel="noreferrer">3</a>. Remember that anyone can send <a href="https://github.com/Lost Pages/Lost Pagesedit" target="_blank" rel="noreferrer">pull requests</a> to our github so don&#39;t be afraid to help us fix things like this.</p></li><li><p>Added a mirror of our site to <a href="https://Lost Pages.github.io/Lost Pagesedit/" target="_blank" rel="noreferrer">github.io</a>.</p></li></ul><hr><h3 id="stars-added-⭐" tabindex="-1">Stars Added ⭐ <a class="header-anchor" href="#stars-added-⭐" aria-label="Permalink to &quot;Stars Added ⭐&quot;">​</a></h3><ul><li><p>Starred updated guides for both <a href="/system-tools#windows-isos">Windows Piracy</a> and <a href="/text-tools#text-editors">Office Piracy</a>.</p></li><li><p>Starred <a href="/file-tools#file-hosts">Buzzheavier</a> in File Hosts. No upload limit, files last forever.</p></li><li><p>Starred <a href="/internet-tools#url-tools">Linqbin</a> in URL Tools. Privacy focused temp link shortener/pastebin, made by one of our discord mods.</p></li><li><p>Starred <a href="/gamingpiracyguide#game-repacks">Gnarly Repacks</a> in Game Repacks + ROMs. Trusted repacker who&#39;s been around for years.</p></li><li><p>Starred <a href="/videopiracyguide#multi-server">PrimeFlix</a> in Streaming Sites. Nice UI, fast 1080p, lots of hosts.</p></li><li><p>Starred <a href="/videopiracyguide#download-sites">LightDLMovies</a> in Video Download. Fast, single click, 1080p downloads.</p></li><li><p>Starred <a href="/videopiracyguide#anime-downloading">Flugel Anime</a> in Anime DDL. Archive of nyaa.si with fast downloads.</p></li><li><p>Starred <a href="/social-media-tools#fediverse-tools">Divisions by zero</a> in Fediverse Tools. The best piracy focused instance on Lemmy.</p></li><li><p>Starred <a href="/downloadpiracyguide#software-sites">CRACKSurl</a> in Software Sites. Clean scans + admins are members of Lost Pages.</p></li><li><p>Starred <a href="/readingpiracyguide#pdf-search">PDF Drive</a> in PDF Sites as their downloads are working again.</p></li><li><p>Starred <a href="/adblockvpnguide#redirect-bypass">Bypass All Shortlinks</a> in Redirect Bypass. This is a fork of the original script with all tracking elements removed.</p></li></ul><hr><h3 id="things-removed" tabindex="-1">Things Removed <a class="header-anchor" href="#things-removed" aria-label="Permalink to &quot;Things Removed&quot;">​</a></h3><ul><li><p>Removed Tachiyomi as it is <a href="https://tachiyomi.org/news/2024-01-13-goodbye" target="_blank" rel="noreferrer">no longer being developed</a>. We&#39;ve replaced it with its successor <a href="/android-iosguide#android-reading">Mihon</a>, and keep in mind the forks linked there still work.</p></li><li><p>Removed Revanced Extended in YouTube Apps as its been <a href="https://redd.it/1abt4kk" target="_blank" rel="noreferrer">archived</a>.</p></li><li><p>Removed Nitter in Frontends as the lead dev decided to <a href="https://github.com/zedeus/nitter/issues/1155#issuecomment-1913361757" target="_blank" rel="noreferrer">call it quits</a>.</p></li><li><p>Removed Erai-Raws in Anime DDL as they&#39;re closing registrations.</p></li><li><p>Removed WorldCinema in Video DDL as they&#39;ve gone premium only.</p></li><li><p>Removed /r/ApkApps Megathread as its no longer updated.</p></li><li><p>Removed Lunar Client in Minecraft Launchers as its closed-source and their privacy policy is <a href="https://i.imgur.com/2Wtds7l.png" target="_blank" rel="noreferrer">very poor</a>.</p></li><li><p>Unstarred LibreWolf as Mullvad Browser is a similar project with <a href="https://i.imgur.com/GTzWHR0.png" target="_blank" rel="noreferrer">auto updates</a>.</p></li><li><p>Unstarred Zoo in AI Chatbots as its no longer unlimited.</p></li><li><p>Unstarred Phind in AI Chatbots as it no longer offers free GPT-4.</p></li></ul>',9))])}const b=i(d,[["render",l]]);export{g as __pageData,b as default};
